import React from "react";
import {
  FlatList,
  TouchableOpacity,
  View,
  Text,
  Image,
  StyleSheet,
} from "react-native";
import { colors, fonts } from "@/theme";

interface Unit {
  id: string;
  name: string;
  type: string;
  location: string;
}

interface UnitListProps {
  onUnitPress?: () => void;
}

const units: Unit[] = [
  { id: "1", name: "BRAVO", type: "Residential", location: "Toronto, ON" },
  {
    id: "2",
    name: "SUGAR WHARF",
    type: "Residential",
    location: "Toronto, ON",
  },
];

const UnitList: React.FC<UnitListProps> = ({ onUnitPress }) => {
  const renderUnit = ({ item }: { item: Unit }) => (
    <View style={{ paddingHorizontal: 16, paddingVertical: 8 }}>
      <TouchableOpacity onPress={onUnitPress}>
        <View style={styles.unitCard}>
          <Image
            style={styles.unitImage}
            source={require("../../assets/images/bravoimage.png")}
          />
          <View style={styles.unitInfo}>
            <Text style={styles.unitName}>{item.name}</Text>
            <Text style={styles.unitDetails}>
              {item.type} â€¢ {item.location}
            </Text>
          </View>
        </View>
      </TouchableOpacity>
    </View>
  );

  return <FlatList data={units} renderItem={renderUnit} />;
};

const styles = StyleSheet.create({
  unitCard: {
    backgroundColor: "white",
    borderRadius: 8,
    padding: 8,
    // marginBottom: 8,
    flexDirection: "row",
    alignItems: "center",
    elevation: 2,
  },
  unitImage: {
    width: 114,
    height: 88,
  },
  unitInfo: {
    marginLeft: 8,
  },
  unitName: {
    fontSize: 16,
    fontWeight: "700",
    fontFamily: fonts.calibri.bold,
    color: colors.primary,
    marginBottom: 4,
  },
  unitDetails: {
    fontSize: 14,
    fontFamily: fonts.calibri.regular,
    color: colors.gray,
  },
});

export default UnitList;
